import React from 'react';
import logo from '../img/logos.png'
import headimg from '../img/headimg.png'
// import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
// import { faFacebook,faInstagram,faYoutube } from '@fortawesome/free-brands-svg-icons';
// import { faPhoneAlt, faArrowCircleDown} from '@fortawesome/free-solid-svg-icons'
import { Navbar, Nav, } from 'react-bootstrap';
const Navigation = () => {


  var loginButton;
  window.onscroll = ()=> {runMe()};
  
  function runMe() {
    if (document.body.scrollTop > 200 || document.documentElement.scrollTop > 200) {
      loginButton.classList.add("addme");
    } else {
      loginButton.classList.add("addme");
    }
  }
  
  // let sub= document.getElementById("subnanvar")

  // window.onscroll = ()=> {runMe()};
  
  // function runMe() {
  // if (document.body.scrollTop > 200 || document.documentElement.scrollTop > 200) {
  //     sub.classList.add("addme");
  // } 
  // else {
  //     sub.classList.remove("addme");
  // }
  // }
  // ;
  return (

   
    <div className="navbar_body">
      <Navbar collapseOnSelect expand="lg"  id="subnanvar">
        <div className="container">
        <Navbar.Brand href="#home"><img src={logo} className="logo " alt="logo" /></Navbar.Brand>
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Navbar.Collapse id="responsive-navbar-nav">
          <Nav className="ml-auto menuitem">
            <Nav.Link href="#hm" id ="home">Home</Nav.Link>
            <Nav.Link href="#srcv" id ="home" >Service</Nav.Link>
            <Nav.Link href="#skl" id ="home" >Skill</Nav.Link>
            <Nav.Link href="#abt" id ="home" >About Me</Nav.Link>
            <Nav.Link href="#cntc" id ="home" >Contact</Nav.Link>
          </Nav>
          </Navbar.Collapse>
          </div>
      </Navbar>


      {/* Bodytext */}
      <section id="hm">
        
      <div className="container" >
        <div className="row">
          <div className="col-md-6">
            <div className="nametext" data-aos="fade-right">
            <h1 className="animate__animated animate__rotateInUpLeft" > Hello I`m </h1>
            <h1>Rabin Subedi</h1>
            <p> Web Designer</p>
            <button className="btn btn-success hirebutton">Hire Me</button>
            </div>
          </div>
          <div className="col-md-6">
            <img src={headimg} className="headimage" alt="logoimage"></img>
          </div>
        </div>
      </div>
     </section>

    </div>
  )
}
export default Navigation;
